import './App.css';
import RegisterPage from './Pages/register';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

function App() {
  return (
    <Router>
      <nav>
        <Link to="/regi"></Link>
      </nav>

      <Routes>
        <Route path='/regisration' element={<RegisterPage/>} />
      </Routes>
    </Router>
  )


}

